$(function(){
    $('label').hide();
    $('.point').click(function(){
        var hue = 'rgb(' + (Math.floor((256-199)*Math.random()) + 200) + ','

$('label a').css("color", hue);
        
        $('label a').slideToggle("slow");
        return false;
      
      
    });
});
   $(function(){
    $('.drowing1').hide();
        $("ul li:first-of-type").click(function() {
